package com.xmmxjy.system.entity;import javax.persistence.Id;import javax.persistence.Table;import java.io.Serializable;import java.util.Date;/** * 描述：角色 * @author: xmm * @since：2016年09月19日 16时37分13秒 星期一  * @version:1.0 */@Table(name = "rh_role")public class RoleEntity implements Serializable{	private static final long serialVersionUID = 1L;		/**	 *ID	 */	@Id	private String id;	/**	 *角色编码	 */	private String roleCode;	/**	 *角色名称	 */	private String roleName;	/**	 *修改人	 */	private String updateName;	/**	 *修改时间	 */	private Date updateDate;	/**	 *修改人id	 */	private String updateBy;	/**	 *创建人	 */	private String createName;	/**	 *创建时间	 */	private Date createDate;	/**	 *创建人id	 */	private String createBy;	public String getId() {	    return this.id;	}	public void setId(String id) {	    this.id=id;	}	public String getRoleCode() {	    return this.roleCode;	}	public void setRoleCode(String roleCode) {	    this.roleCode=roleCode;	}	public String getRoleName() {	    return this.roleName;	}	public void setRoleName(String roleName) {	    this.roleName=roleName;	}	public String getUpdateName() {	    return this.updateName;	}	public void setUpdateName(String updateName) {	    this.updateName=updateName;	}	public Date getUpdateDate() {	    return this.updateDate;	}	public void setUpdateDate(Date updateDate) {	    this.updateDate=updateDate;	}	public String getUpdateBy() {	    return this.updateBy;	}	public void setUpdateBy(String updateBy) {	    this.updateBy=updateBy;	}	public String getCreateName() {	    return this.createName;	}	public void setCreateName(String createName) {	    this.createName=createName;	}	public Date getCreateDate() {	    return this.createDate;	}	public void setCreateDate(Date createDate) {	    this.createDate=createDate;	}	public String getCreateBy() {	    return this.createBy;	}	public void setCreateBy(String createBy) {	    this.createBy=createBy;	}}